async function send(username: string,password: string)
{
  const data = await CheckData(username);
  if(data !== "No data available")
  {
    console.log("Return");
    return;
  }
  SendData(username,password);
}
function App() {

  return (
    <div className="App">
      <div className="content">
        <div>
          <button onClick = {()=> send("Shubham","334")}>
            Send Data
          </button>
          <p>
            {}
          </p>
        </div>
        <Wallet />
      </div>
    </div>
  );
}

export default App;
